import React, {Fragment} from 'react';
import { BrowserRouter } from 'react-router-dom';
import { createGlobalStyle } from 'styled-components';

import variables from './constants/styleVariables';

import HeaderComponent from './components/HeaderComponent/HeaderComponent';
import HomePage from './pages/HomePage'
import AboutPage from './pages/HomePage'

function App() {
  return (
    <BrowserRouter>
      <Fragment>
        <GlobalStyle />
        <HeaderComponent />

        <Switch location={location}>
          <Route path={ROUTES.ROOT} exact component={HomePage}/>
          <Route path={ROUTES.ABOUT} component={HomePage} />
          <Route path={ROUTES.BOOKINGS} component={ExampleComponent} />
          <Route path={ROUTES.PAYMENTS} component={ExampleComponent} />
          <Route path={ROUTES.CONTACT} component={ExampleComponent} />
          <Route path={ROUTES.SUPPORT} component={ExampleComponent} />
          <Route path={ROUTES.LOGOUT} component={ExampleComponent} />
          <Route path={ROUTES.ABOUT} component={ExampleComponent} />
          <Route path={ROUTES.FAQ} component={ExampleComponent} />
          <Route path={ROUTES.APPLICATION} component={ExampleComponent} />
          <Route path={ROUTES.FLIGHTS} component={ExampleComponent} />
        </Switch>

      </Fragment>
    </BrowserRouter>
  );
}


const GlobalStyle = createGlobalStyle`
  * {
    box-sizing: border-box;
    padding: 0;
    margin: 0;
    outline: none;
    font-family: ${variables.fonts.primary};

    &:link, &:visited, &:hover, &:focus, &:active {
      outline: none;
     }
  }
`;

export default App;
